65	Cities in New Jersey and New York with Highest Percentage of Divorces	2018-02-20 10:55:38.784388-06	On January 29, 2018, John Harrington and Cheyenne Buckingham of 24/7 Wall St published the list of the city in each state that has the highest percentage of divorces among individuals aged 15 years and older.  The data were compiled from U.S. Census Bureau data.  Since we handle uncontested divorces and contested divorces in both New Jersey uncontested divorces and contested divorces and New York uncontested divorces and contested divorces, we will examine their findings for New Jersey and New York.\r\n\r\nFirst, the 24/7 Wall Street report found that Crestwood Village, New Jersey, has the highest divorce rate of any city in New Jersey.  In Crestwood Village, the percent of the population aged 15 years or older that has been divorced is 16.4%.  This is nearly double the 8.5% number for New Jersey statewide.  44.1% of the population of Crestwood Village is married.  The median household income in Crestwood Village is $28,282, and only 8.0% of households earn less than $10,000.\r\n\r\nNext, the report found that Hudson, New York, has the highest divorce rate of any city in New York.  The divorced population constituted 16.7% of all people in Hudson aged 15 or older.  This was significantly higher than the 8.7% rate for New York statewide.  Only 29.6% of the population in Hudson, New York, is married.  The median household income in Hudson is $31,042, but 13.3% of households in Hudson earn less than $10,000.\r\n\r\nInterestingly, the survey shows that the percentage of divorced populations of New Jersey and New York statewide is similar.  Furthermore, the cities in each state with the highest divorce rates also had several similar statistics.\r\n\r\nSource:  Harrington, John and Cheyenne Buckingham.  “The Divorce Capital of Every State.”  24/7 Wall St, Jan. 29, 2018.  https://247wallst.com/special-report/2018/01/29/divorce-capital-of-every-state/	3	f	f	f	t		248	https://divorcesus.com	0
62	Our NYC Family Law Attorneys are Expert Immigration Law Attorneys As Well	2018-02-18 19:50:52.229667-06	Our experienced New York and New Jersey family law attorneys represent clients in virtually every area of family law in New York and New Jersey.  Please see our “Services” field to learn about all of the areas in which we assist clients in New York and New Jersey.\r\n\r\nHowever, The Law Offices of Grinberg & Segal, PLLC, our New York family law lawyers are not only experts in New York and New Jersey family and divorce law, but also in all areas of immigration law,  representing clients throughout the United States and abroad.  We encourage those who have family law questions pertaining to immigration matters, such as petitioning for spouses and relatives, establishing the bona fides of a marriage, immigration protection under the Violence Against Women Act (VAWA), international adoption, or understanding the effect of divorce on immigration status to see myattorneyusa.com, the website for Grinberg & Segal’s immigration law division.\r\n\r\nAt The Law Offices of Grinberg & Segal, PLLC, we provide all of our family law and immigration law clients with the expert representation and careful consideration that they deserve.  Please do not hesitate to contact us today if there is an issue that our experienced New York family law attorneys can help you with.	3	f	f	f	t		248	https://divorcesus.com	0
64	Increase in "Gray Divorces"	2018-02-20 10:52:39.054395-06	Erica Lamberg of myCentralJersey published an article about a new book on “gray divorces,” that is, divorces involving couples where at least one of the parties is aged fifty or over.  The book, titled “Gray Divorce:  What We Lose and Gain from Mid-Life Splits” is authored by Jocelyn Elise Crowley, Ph.D., a professor and researcher at Rutgers University.  The article discusses many of Crowley’s research findings regarding “gray divorces.”\r\n\r\nIn the article, we learn that the rate of “gray divorces” has increased sharply in recent years.  From 1990-2010, the rate of “gray divorces” doubled, and approximately one out of every four divorces today involves at least one party who is at least 50 years old.\r\n\r\nAlthough age far from dispositive as to the complexity of the divorce, many older couples are likely to have more assets to negotiate than younger couples.  In this sense, the uptick in gray divorces may often correspond with an uptick in highly complex divorce matters.  In cases where there are significant assets at stake, parties to a divorce may benefit greatly from the counsel of an experienced divorce attorney who can help protect their interests and work toward an amicable agreement on as many of the contested  issues as possible.\r\n\r\nSource:  Lamberg, Erica.  “Rutgers professor writes book about mid-life divorce trends.”  myCentralJersey.  Feb. 20, 2018.  https://amp.mycentraljersey.com/amp/324448002	3	f	f	f	t		248	https://divorcesus.com	0
63	New Tax Law Eliminates Alimony Deduction Starting for Divorces Finalized in 2019	2018-02-18 19:52:31.073851-06	On February 15, 2018, Bloomberg Politics published an article titled “Trump’s Tax Law Could Make Divorces More Bitter.”  The article explains that, starting in 2019, the new tax law will no longer allow for the deduction of alimony from the payer’s taxable income.  In effect, the new rules will apply to divorces that are finalized beginning in 2019.  The article suggests that the new rules may prompt some to move to finalize their divorces before the new tax rules kick in.  \r\n\r\nAlimony is not an issue in every divorce matter.  However, in many divorce negotiations and divorce proceedings, alimony is one of the most pressing issues in the case.\r\n\r\nIn complicated cases, a party to a divorce can benefit greatly from the counsel of an experienced family law attorney who understands the divorce laws of the state having jurisdiction over the divorce.  At The Law Offices of Grinberg & Segal, PLLC, we handle all types of New York and New Jersey divorce matters, from relatively simple uncontested divorces to highly complicated contested divorces.  Where applicable, we consider alimony in the context of divorce negotiations and proceedings and work to offer our clients the best representation in New York and New Jersey .  Please see our section on alimony to learn more about this issue.\r\n\r\nSource:  Steverman, Ben.  “Trump’s Tax Law Could Make Divorces More Bitter.”  Bloomberg Politics.  Feb. 15, 2018.  https://www.bloomberg.com/news/articles/2018-02-15/tax-overhaul-seen-spurring-more-acrimonious-divorce-negotiations	3	f	f	f	t		248	https://divorcesus.com	0
