1	<section class="published-paragraph">\r\n<p>\r\nAt The Law Offices of Grinberg &amp; Segal, PLLC, we offer immigration consultations with top notch New York City immigration attorneys. You may request to schedule an in-person consultation with one of our immigration lawyers of your choice. We also offer online as well as over-the-phone consultations. Our fee is $160 for a 45-minute (or $49 for a 15-minutes) consultation with one of our experienced immigration lawyers. We also offer a one-time free 15-minute immigration lawyer consultation for asylum-seekers. To schedule a consultation, please use the form&nbsp;below.\r\n</p>\r\n</section>\r\n<section class="published-paragraph">\r\n<p>The offered 45-minute consultation time is usually sufficient for an initial legal consultation of a general nature. Please note that except for a one 15-minute consultation for asylum seekers, we do not offer free consultations. We also do not provide second opinions on a fifteen-minute free consultation basis for asylum seekers. That is because in our view, any such consultation cannot be reasonably offered within a fifteen-minutes time slot, even if only general information is sought. Since a more particular and fact-specific consultation is required in such cases, or may be desired in others, a longer time would be needed for an immigration attorney to analyze the&nbsp;facts.</p>\r\n</section>\r\n\r\n<section class="published-paragraph">\r\n<p>The one hundred and sixty dollars ($160) fee covers up to 45 minutes (or $49 up to 15 minutes) of immigration consultation with an experienced immigration and deportation attorney of your choice. We accept all major credit cards including Visa, Master Card, American Express and Discover. When you request a consultation, you will be first required to fill out the payment form and after the payment is accepted, the consultation form, which will ask you for basic information about you and your situation. Kindly, enter all the information requested. Please, do not skip any of the required fields, which are marked with an “*” sign. We are bound by law to preserve complete confidentiality of your information. Thus, your information is not shared with any third parties. However, this information is needed to an immigration attorney for purposes of providing a desired immigration consultation. Hence, please make sure the information you enter is correct and&nbsp;accurate.</p>\r\n</section>\r\n\r\n<section class="published-paragraph">\r\n<p>Once the information is entered, kindly click the “submit” button to request your immigration consultation. Upon receipt of your request, we will contact you via phone, Skype or email to schedule a consultation with one of our immigration attorneys in the manner most preferred by you. Please note that it usually takes up to 48 hours for us to contact you to schedule an immigration consultation. Please do not use this form if you would like to ask a free question online. In such a case, please use our Ask A Question form in the same drop-down menu. We answer your questions free of charge, provided the legal information you seek in such an exchange is of general legal nature. If after having asked your question and obtained your free answer, you decide to seek a paid legal consultation of a more detailed and fact-specific nature about your immigration issue, please return to this form to schedule your immigration&nbsp;consultation.</p>\r\n</section>			\N
